import React from 'react';

import Select from 'react-select';

var colourOptions =
[
  {
    "text"  : "Option 1",
    "value" : "Value 1"
  },
  {
    "text"     : "Option 2",
    "value"    : "Value 2",
    "selected" : true
  },
  {
    "text"  : "Option 3",
    "value" : "Value 3"
  }
];
export default () => (
  <Select
    isMulti
    name="colors"
    options = {'aaa', 'bbbb', 'jjjjj'}
    className="basic-multi-select"
    classNamePrefix="select"
  />
);
